import * as types from '../Actions/actionTypes'

const initialstate = {
    hide:false,
    editmode:false
}
const formreducer = (state=initialstate,action)=>{
    switch(action.types){
        case types.EDITMODE:
            return({...state,hide:true})
        default:
            return state
    }   
}
export default formreducer
